        L.Graticule = L.LayerGroup.extend({
            options: {

                showLabel: true,
                opacity: 0.6,
                color: '#000',
                weight: 0.7,

                dashArray: '5,5'

            initialize: function (options) {
                L.LayerGroup.prototype.initialize.call(this);
                L.Util.setOptions(this, options);
                this._layers = {};
            },
            onAdd: function (map) {
                this._map = map;

                var graticule = this;

                function createGraticule() {
                    graticule._update();
                }

                map.on('viewreset', createGraticule, this);
                map.on('moveend', createGraticule, this);
                this._update();
            },
            onRemove: function (map) {
                map.off('viewreset', this._update, this);
                map.off('moveend', this._update, this);
                this.eachLayer(this.removeLayer, this);
            },
            _update: function () {
                var map = this._map,
                    bounds = map.getBounds(),
                    zoom = map.getZoom();

                this.eachLayer(this.removeLayer, this);

                var interval = this.options.interval;

                var latLines = [];
                for (var lat = Math.floor(bounds.getSouth() / interval) * interval; lat <= bounds.getNorth(); lat += interval) {
                    latLines.push(lat);
                }

                var lngLines = [];
                for (var lng = Math.floor(bounds.getWest() / interval) * interval; lng <= bounds.getEast(); lng += interval) {

                        [latLines[i], bounds.getEast()]
                    ], {
                        weight: this.options.weight,
                        color: this.options.color,
                        opacity: this.options.opacity,
                        interactive: false,
                        dashArray: this.options.dashArray
                    }).addTo(this);

                                html: '<div style="font: ' + this.options.font + '">' + latLines[i].toFixed(1) + '°</div>'
                            }),
                            interactive: false
                        }).addTo(this);
                    }
                }

                    var lngLine = L.polyline([
                        [bounds.getSouth(), lngLines[i]],
                        [bounds.getNorth(), lngLines[i]]
                    ], {
                        weight: this.options.weight,
                        color: this.options.color,
                        opacity: this.options.opacity,
                        interactive: false,
                        dashArray: this.options.dashArray
                    }).addTo(this);

                            }),

                        }).addTo(this);
